import {ExerciseStore} from './ExerciseStore'
import {TimerStore} from './TimerStore'

export class RootStore {
  exercise: ExerciseStore
  timer: TimerStore

  constructor() {
    this.exercise = new ExerciseStore(this)
    this.timer = new TimerStore(this)
  }
}
